DROP TABLE IF EXISTS `Students`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `Students` (
  `NeuId` varchar(16) NOT NULL,
  `PublicId` int(11) NOT NULL AUTO_INCREMENT,
  `Email` varchar(255) NOT NULL,
  `FirstName` varchar(25) NOT NULL,
  `MiddleName` varchar(25) DEFAULT NULL,
  `LastName` varchar(25) NOT NULL,
  `Gender` enum('M','F') NOT NULL,
  `Race` varchar(25) DEFAULT NULL,
  `Scholarship` tinyint(1) DEFAULT 0,
  `Visa` varchar(5) DEFAULT NULL,
  `Phone` varchar(25) DEFAULT NULL,
  `Address` varchar(255) DEFAULT NULL,
  `State` varchar(2) DEFAULT NULL,
  `City` varchar(20) DEFAULT NULL,
  `Zip` varchar(5) DEFAULT NULL,
  `EntryTerm` enum('SPRING','SUMMER','FALL') DEFAULT NULL,
  `EntryYear` int(11) NOT NULL,
  `ExpectedLastTerm` enum('SPRING','SUMMER','FALL') DEFAULT NULL,
  `ExpectedLastYear` int(11) NOT NULL,
  `EnrollmentStatus` enum('FULL_TIME','PART_TIME','GRADUATED','INACTIVE','DROPPED_OUT') NOT NULL,
  `Campus` enum('BOSTON','CHARLOTTE','SEATTLE','SILICON_VALLEY') NOT NULL,
  `DegreeCandidacy` enum('ASSOCIATE','BACHELORS','MASTERS','PHD') NOT NULL,
  `Photo` blob DEFAULT NULL,
  `Visible` tinyint(1) DEFAULT 1,
  `Linkedin` varchar(50) DEFAULT NULL,
  `Facebook` varchar(50) DEFAULT NULL,
  `Github` varchar(50) DEFAULT NULL,
  `Website` varchar(50) DEFAULT NULL,
  `Skills` varchar(255) DEFAULT NULL,
  `Summary` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`NeuId`),
  UNIQUE KEY `uq_Students_Email` (`Email`),
  KEY `PublicId` (`PublicId`)
) ENGINE=InnoDB AUTO_INCREMENT=406 DEFAULT CHARSET=latin1;
/*!40101 SET character_set_client = @saved_cs_client */;

